#include <fuzzer/FuzzedDataProvider.h>
#include "Object.h"
#include "Dict.h"
#include "Stream.h"
#include "SplashOutputDev.h"
#include "GfxState.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    FuzzedDataProvider stream(data, size);

    // Initialize parameters for drawChar function
    GfxState state(0, 0, nullptr, 0, gFalse);
    double x = stream.ConsumeFloatingPoint<double>();
    double y = stream.ConsumeFloatingPoint<double>();
    double dx = stream.ConsumeFloatingPoint<double>();
    double dy = stream.ConsumeFloatingPoint<double>();
    double ox = stream.ConsumeFloatingPoint<double>();
    double oy = stream.ConsumeFloatingPoint<double>();
    CharCode code = stream.ConsumeIntegral<CharCode>();
    int nBytes = stream.ConsumeIntegral<int>();
    Unicode *u = nullptr;
    int uLen = 0;
    GBool vertical = stream.ConsumeBool();
    GBool rotated = stream.ConsumeBool();
    GBool upsideDown = stream.ConsumeBool();

    // Create an instance of SplashOutputDev with necessary arguments to call drawChar function
    SplashOutputDev splashOutputDev(splashModeRGB8, 0, gFalse, nullptr, gTrue, gTrue);
    splashOutputDev.drawChar(&state, x, y, dx, dy, ox, oy, code, nBytes, u, uLen, vertical, rotated, upsideDown);

    return 0;
}

